import React from "react";
import styled from "styled-components";
import { SmallSubtitle } from "../styled/typos";
const member = props => {
  return (
    <Container>
      <SmallSubtitle>{props.subTitle}</SmallSubtitle>
    </Container>
  );
};

export default member;

const Container = styled.div`
  position: relative;
`;
